import { Menu, MenuItem, MenuList } from "@mui/material";
import text from '../text.json';



export default function NavMenu(){
    return(
        <>
            <Menu open={true}>
                    {text.map((x) => {
                        return(
                            <MenuItem>{x.page}</MenuItem>
                        );
                    })}
            </Menu>
        </>
    );
}
